import React from 'react';
import styled from 'styled-components';
import Plx from 'react-plx';
import CarInfoDisplay from './CarInfoDisplay';

const StyledSlideTwo = styled.div`
  position: relative;
  opacity: 0;
  width: 100vw;


  .sticky-trigger-1 {
    margin-top: 50vh;
  }
`;

function SlideTwo() {
  return (
      <>

        <Plx>
          <StyledSlideTwo>
              <CarInfoDisplay />
          </StyledSlideTwo>
        </Plx>
      </>
  );
}

export default SlideTwo;
